        ,\"body\":\"## 0.16.0\\n- _Added `--height HEIGHT[%]` option_\\n  - fzf can\
        \ now display finder without occupying the full screen\\n- Preview window\
        \ will truncate long lines by default. Line wrap can be enabled\\n  by `:wrap`\
        \ flag in `--preview-window`.\\n- Latin script letters will be normalized\
        \ before matching so that it's easier\\n  to match against accented letters.\
        \ e.g. `sodanco` can match `S\xF3 Dan\xE7o Samba`.\\n  - Normalization can\
        \ be disabled via `--literal`\\n- Added `--filepath-word` to make word-wise\
        \ movements/actions (`alt-b`,\\n  `alt-f`, `alt-bs`, `alt-d`) respect path\
        \ separators\\n\"},{\"url\":\"https://api.github.com/repos/junegunn/fzf-bin/releases/5095718\"\
